import React from "react";
import Card from "../components/Card";
import FeatureCard from "../components/FeatureCard";

const HomePage = () => {
  return (
    <>
      <FeatureCard />
      <div className="row">
        {/* Left Panel of Page */}

        <div className="col-md-8 m-3 p-3">
          <h4 className="display-5 mx-2 p-2">Recent Posts</h4>
          <Card />
        </div>

        {/* Right Panel of Page */}
        <div className="col-md-3 m-3 p-3">
          <h4 className="display-5 mx-2 p-2">Popular Posts</h4>
          {/* ============================================Small Card============================================ */}
          <div className="card p-2 mt-3">
            <div className="row">
              <div className="col-md-8">
                <div className="card-body">
                  <h5 className="card-title">Digital Living</h5>
                  <p className="card-text">
                    What Can ChatGPT Really Do? 6 Amazing
                  </p>
                </div>
              </div>
              <div className="col-md-4">
                <img
                  src="/images/posts-image/1p.webp"
                  className="rounded-start"
                  width={90}
                  height={90}
                  alt="..."
                />
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default HomePage;
